function doAction() {
    this.owner.submorphs.each(function(ea) {
            var min = 0,
                max = 15,
                length = 10,
                variation = 12,
                lastNumber = Math.floor(Math.random() * (max-min) + min),
                random = function(min, max, length, variation) {
                    return Math.max(min,
                        Math.min(max,
                            Math.floor(
                                lastNumber + (Math.random() - 0.5) * variation
                        )));
                },
                result = lastNumber;
            for (var i = 1; i < length; i++) {
                lastNumber = random(min, max, length, variation);
                result +=', '+lastNumber;
            }

            ea.textString = result;
        });
}

